    console.log(data)
    console.log('datas de logica')
    console.log(data.onGuardar)
    console.log(data.opens)
   // console.log(open)






    const _GuardarTemas =(e)=>{
        e.preventDefault()
        console.log("_guardar")
        data.onGuardar()
    }
   const handleClose=()=>{
    console.log("Close")
    setOpen()
    
   }

        return(
            <div>
<Dialog opens={open} onClose={handleClose} aria-labelledby="form-dialog-title">
        <DialogTitle id="form-dialog-title">Nota...</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Confirme que las fechas seleccionadas
            son las correctas para las evaluaciones formativas.
            No podr√° hacer cambios.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Cancelar
          </Button>
          <Button onClick={_GuardarTemas} color="primary">
            Confirmar
          </Button>
        </DialogActions>
      </Dialog>
            </div>
        );
    
}
